import * as React from 'react';
import { createMaterialBottomTabNavigator } from '@react-navigation/material-bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import TabBar from './TabBar';
import Home from '../../Screens/home/Home';
import { useStyles } from '../lib/style/useStyle';
// import Profile from '../screens/profile/Profile';
// import Order from '../screens/order/Order';
// import MyOrder from '../screens/order/MyOrder';
import AuthScreen from '../../Screens/auth/AuthScreen';
import Profile from '../../Screens/profile/Profile';
import askQuestion from '../../Screens/askQuestion/askQuestion';
import showMyQuestions from '../../Screens/AllQuestions/showMyQuestions';
import { profileIcon } from '../../../assets/profile.png';
import { AuthNavigator, ProfileStackNavigation, QuestionStack, UserNavigator } from '../../../Routes';
import allLawyers from '../../Screens/Lawyers/allLawyers';
import LawyerHome from '../../Screens/home/LawyerHome';
import AnswerAllQueries from '../../Screens/AnswerQuestions/AnswerQuestions';
// import ViewBlawg from '../screens/Blawgs/ViewBlawg';
const ProfileStack = createStackNavigator();

export const ProfileStackNavigator = () => {
    return (
        <ProfileStack.Navigator
            screenOptions={{
                headerShown: false,
            }}>
            <ProfileStack.Screen name="Profile" component={Profile} />
            <ProfileStack.Screen name="Auth" component={AuthNavigator} />
        </ProfileStack.Navigator>
    );
};


const Tab = createMaterialBottomTabNavigator();
export default function BottomTabNavigator() {
    const commonStyle = useStyles();
    return (
        <Tab.Navigator
            initialRouteName='Home'
            component={LawyerHome}
            // tabBar={props => <TabBar {...props} />}
            activeColor="#FFFFFF"
            inactiveColor="#FFFFFF"
            screenOptions={{
                headerShown: false
            }}
            barStyle={{ backgroundColor: '#29406C' }}
        >
            <Tab.Screen name="Home" component={LawyerHome} options={{ headerShown: false, }} />
            <Tab.Screen
                name="Profile"
                component={ProfileStackNavigator}
                options={{ headerShown: false }}
            />
            <Tab.Screen
                name="AllQuestions"
                component={QuestionStack}
                options={{ headerShown: false }}
            />
        </Tab.Navigator>
    );
}
